import React from 'react'
import Nav from '../../components/layout'
import Link from 'next/link'
import {useQuery} from '@apollo/client'
import {GET_ACCESS_BY_HOSPITAL} from '../../graphql/schema'


const Dashboard = ()=>{

    const {data,loading} = useQuery(GET_ACCESS_BY_HOSPITAL)


    return(
        <>
            <Nav />
            <br /><br />
            
            <div className="container">
            <h5>Patient list</h5>
            {
                loading ? <p>Loading...</p>:
                <table className="striped">
                    <thead>
                    <tr><th>#</th><th>Customer Name</th><th>Created</th><th>...</th></tr>
                    </thead>
                    <tbody>
                        {
                            data ? data.getAccessByHospital.map(({id},i)=>(
                                <tr key={i}><td>{1+i}.</td><td><Link href="#"><a>Abiodun Michael</a></Link></td><td>12-12-2019</td><td><Link href="/hos/record/jfdhhhdfh"><a><i className="material-icons">visibility</i></a></Link></td></tr>
                            )):null
                        }
                      
                        </tbody>
                </table>
            }
                
            </div>
        </>
    )
}

export default Dashboard
